import React, { useEffect, useState } from 'react'
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Import BrowserRouter, Routes, and Route

//Componunt
import NavBar from './componunts/NavBar.jsx'
//Pages
import Home from './pages/Home.jsx'
import FlagDetails from './pages/FlagDetails.jsx';


import {DarkModeProvider} from './customeHooks/DarkModeContext.jsx'


function App() {
  return (
    <DarkModeProvider>
      <Router>
        <header className="w-100 bg-white">
          <NavBar />
        </header>
        <main className={`container`}>
          <Routes>
            <Route path="/" exact component={Home} />
            <Route path="/flagDetails/:code" component={FlagDetails} />
          </Routes>
        </main>
      </Router>
    </DarkModeProvider>
  );
}

export default App;
